import React from 'react';
import './Exchanger.scss';
import {Input} from "./Input"
import {Label} from "./Label"

const USD = {}

class Exchanger extends React.Component {
  constructor(props) {
    super (props);
  }

  render () {
    return (
        <fieldset className="app-exchanger">
            <legend className="USD">Enter currency in $, USD</legend>
            <Label for="USD" currency="USD"></Label>
            <Input id="USD" placeholder="USD"></Input>
        </fieldset>
    );
  }
}


export {Exchanger};
